import React, { Component } from 'react';
import './App.css';
import Titles from './components/Titles';

class App extends Component {
  render() {
    return (
      <div className="App">
       <h1>Hello</h1>
       <p>YO!</p>
      </div>
    );
  }
}

export default App;
